import React from 'react'

const NavigationLinks = (props) =>{
    return(
        <ul className = "flex justify-evenly items-center flex-grow mx-20">
            {props.logged!=null && <li className = "font-artistic text-4xl text-black transition duration-500 ease-in-out transform hover:scale-125 motion-reduce:transform-none"><button onClick = {() => {props.clearCookies()}}>Logout</button></li>}
        </ul>
    );
}

export default NavigationLinks;
